import React from 'react';
import logo from '../assets/main/Logo.svg';
import pageError from '../assets/main/pageError.svg';

const NotFound = () => {
    return (
        <section
            className={'bg-white py-3 px-5 text-2xl font-roboto font-extralight w-full flex flex-col justify-center items-start min-h-full'}>

            <div className="logo">
                <img className='w-16 h-16' src={logo} alt="logo" />
            </div>

            <div className='flex flex-1 flex-col gap-7 text-center justify-center items-center w-full'>
                <h1>Упс...</h1>

                <img className='w-32 h-3w-32' src={pageError} alt="avatar_registration" />

                <p>Похоже, такой страницы не существует или она была удалена...</p>
            </div>


        </section>
    )
}

export default NotFound;
